function UrlEncode(str){
	let i, c, p, q, ret="", strSpecial="!\"#$%&'()*+,/:;<=>?@[\]^`{|}~%";
	for(i = 0; i < str.length; i++){
		if(str.charCodeAt(i) >= 0x4e00){
			p = strGB[str.charAt(i)];
			if(p !== undefined){
				q = p % 94;
				p = (p - q) / 94;
				ret += ("%"+(0xB0+p).toString(16)+"%"+(0xA1+q).toString(16)).toUpperCase();
			}
		}
		else{
			c = str.charAt(i);
			if(c == " ")
				ret += "+";
			else if(strSpecial.indexOf(c)!=-1)
				ret += "%"+str.charCodeAt(i).toString(16);
			else
				ret += c;
		}
	}
	return ret;
}

const spellCache = globalCache('__localSpellCache__', {
    cache: {},
    count: 0,
    max: 5000,
});

function setCache(str, spell) {
    if (!(str in spellCache.cache)) {
        spellCache.cache[str] = spell;
        spellCache.count += 1;
        if (spellCache.count > spellCache.max) {
            for (const key in spellCache.cache) {
                delete spellCache.cache[key];
                return;
            }
        }
    }
    return spell;
}

export function getSpell(str){
    if (str in spellCache.cache) return spellCache.cache[str];
	var i, c, t, p, ret = "";
	for(i = 0; i < str.length; i++){
        c = str.charAt(i);
		if(str.charCodeAt(i) >= 0x4e00){
			p = strGB[c];
			if(p !== undefined){
                t = qswhSpell[p];
				if(t !== undefined) ret += t;
			} else {
                ret += c;
            }
		} else {
            ret += c;
        }
    }
    return setCache(str, ret);
}

function getSorted(arr: any[], getter?: (item: any) => any) {
    let value, strings = [], numbers = [], nulls = [], empties = [], nans = [];
    for (let i = 0; i < arr.length; i++) {
        // 如果是数组则按数组第一项排序
        value = getter ? getter(arr[i]) : arr[i];
        if (value === null || value === undefined) {
            nulls.push([value, arr[i], i]);
        } else if (value === '') {
            empties.push([value, arr[i], i]);
        } else if (typeof value === 'number') {
            if (isNaN(value)) {
                nans.push([value, arr[i], i]);
            } else {
                numbers.push([value, arr[i], i]);
            }
        } else {
            if (isDate(value)) {
                numbers.push([value.getTime(), arr[i], i]);
            } else {
                strings.push([getSpell(value), arr[i], i]);
            }
        }
    }
    return numbers.sort((a, b) => (a[0] - b[0])).concat(strings.sort()).concat(empties, nans, nulls);
}

export function localSort(arr: any[], sort: 'ASC' | 'DESC' = 'ASC', getter?: (item: any) => any) {
    let sorted = getSorted(arr, getter);
    if (sort === 'DESC') {
        sorted = sorted.reverse();
    }
    return sorted.map(s => s[1]);
}

export function localSortIndexies(arr: any[], sort: 'ASC' | 'DESC' = 'ASC', getter?: (item: any) => any) {
    let sorted = getSorted(arr, getter);
    if (sort === 'DESC') {
        sorted = sorted.reverse();
    }
    const result = [];
    sorted.forEach((s, index) => (result[s[2]] = index));
    return result;
}
